let para = document.createElement('p')
para.textContent = "What is your date of birth?"
let select1 = document.createElement('select')
select1.id = "month-btn"
let select2 = document.createElement('select')
select2.id = "day-btn"
let select3 = document.createElement('select')
select3.id = "year-btn"
let flag = 0

let monthList = ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec']
let changeContent = document.getElementById('change-content')

function defaultFunction() {
    if(flag) {
        changeContent.innerHTML = ""
    }
    select2.innerHTML = `<option value="">Day</option>`
    select3.innerHTML = `<option value="">Year</option>`
    select1.innerHTML = `<option value="">Month</option>`
    for(let i=0; i<monthList.length; i++) {
        select1.innerHTML += `<option value=${monthList[i]}>${monthList[i]}</option>`
    }
    for(let i=1; i<=31; i++) {
        select2.innerHTML += `<option value=${i}>${i}</option>`
    }
    for(let i=1905; i<=2024; i++) {
        select3.innerHTML += `<option value=${i}>${i}</option>`
    }
    changeContent.append(para, select1, select2, select3)
}
defaultFunction()

